import React from 'react';
import { useSelector } from 'react-redux';





const Searchresult = () => {

   const SearchResult = useSelector((state)=> state.search.data.results)
    const loading  = useSelector((state)=> state.search.loading) 

    return (loading===true ? (<h1>...loading</h1>) : (

          <div>

            {SearchResult((media_type,title,overview,poster_path,id) =>{


                 <div key={id}>

                    <div><img src={`https://image.tmdb.org/t/p/w500${poster_path}`} alt="" /></div>
                    <div><h1></h1></div>  

                 </div>







            } )}




          </div>






    ))






}

export default Searchresult;
